#include "misc.hpp"

void Misc::DoBhop(CUserCmd* cmd)
{
	int iType = g_LocalPlayer->m_nMoveType();
	if (iType == MOVETYPE_LADDER || iType == MOVETYPE_NOCLIP)
	{
		return;
	}
	if (cmd->buttons & IN_JUMP)
	{
		cmd->buttons &= ~IN_JUMP;

		if (g_LocalPlayer->m_fFlags() & FL_ONGROUND)
		{
			cmd->buttons |= IN_JUMP;
		}
	}
}

void Misc::DoAutostrafe(CUserCmd* cmd)
{
	static float m_flTrueDirection,
		m_flRoughDirection,
		m_flWishDirection,
		m_flCalculatedDirection,
		m_flStep;

	static bool m_bInTransition,
		m_bIsBhopping;

	if (!g_LocalPlayer || !g_LocalPlayer->IsAlive())
	{
		return;
	}

	enum Directions
	{
		FORWARDS = 0,
		BACKWARDS = 180,
		LEFT = 90,
		RIGHT = -90,
		QUADRANT1 = 45,
		QUADRANT2 = -45,
		QUADRANT3 = -135,
		QUADRANT4 = 135
	};

	m_bIsBhopping = cmd->buttons & IN_JUMP;
	if (!m_bIsBhopping && (g_LocalPlayer->m_fFlags() & FL_ONGROUND))
	{
		m_flCalculatedDirection = Directions::FORWARDS;
		m_bInTransition = false;
		return;
	}

	QAngle vBase{ };
	g_EngineClient->GetViewAngles(vBase);

	auto flGetRoughDirection = [&](float flTrueDirection) -> float
	{
		std::array< float, 8 > uMinimum = { Directions::FORWARDS, Directions::BACKWARDS, Directions::LEFT, Directions::RIGHT, Directions::QUADRANT1, Directions::QUADRANT2, Directions::QUADRANT3, Directions::QUADRANT4 };
		float flBestAngle = vBase.yaw, flBestDelta = 181.f;

		for (size_t i = 0; i < uMinimum.size(); ++i)
		{
			float flRoughDirection = vBase.yaw + uMinimum.at(i);
			float flDelta = fabsf(Math::NormalizeYaw(flTrueDirection - flRoughDirection));

			if (flDelta < flBestDelta)
			{
				flBestAngle = flRoughDirection;
				flBestDelta = flDelta;
			}
		}

		return flBestAngle;
	};

	m_flTrueDirection = g_LocalPlayer->m_vecVelocity().Angle().y;
	if ((cmd->buttons & IN_FORWARD) && !(cmd->buttons & IN_MOVELEFT) && !(cmd->buttons & IN_MOVERIGHT))
	{
		m_flWishDirection = vBase.yaw + Directions::FORWARDS;
	}
	else if ((cmd->buttons & IN_BACK) && !(cmd->buttons & IN_MOVELEFT) && !(cmd->buttons & IN_MOVERIGHT))
	{
		m_flWishDirection = vBase.yaw + Directions::BACKWARDS;
	}
	else if ((cmd->buttons & IN_MOVELEFT) && !(cmd->buttons & IN_FORWARD) && !(cmd->buttons & IN_BACK))
	{
		m_flWishDirection = vBase.yaw + Directions::LEFT;
	}
	else if ((cmd->buttons & IN_MOVERIGHT) && !(cmd->buttons & IN_FORWARD) && !(cmd->buttons & IN_BACK))
	{
		m_flWishDirection = vBase.yaw + Directions::RIGHT;
	}
	else if ((cmd->buttons & IN_FORWARD) && (cmd->buttons & IN_MOVELEFT))
	{
		m_flWishDirection = vBase.yaw + Directions::QUADRANT1;
	}
	else if ((cmd->buttons & IN_FORWARD) && (cmd->buttons & IN_MOVERIGHT))
	{
		m_flWishDirection = vBase.yaw + Directions::QUADRANT2;
	}
	else if ((cmd->buttons & IN_BACK) && (cmd->buttons & IN_MOVERIGHT))
	{
		m_flWishDirection = vBase.yaw + Directions::QUADRANT3;
	}
	else if ((cmd->buttons & IN_BACK) && (cmd->buttons & IN_MOVELEFT))
	{
		m_flWishDirection = vBase.yaw + Directions::QUADRANT4;
	}
	else
	{
		cmd->buttons |= IN_FORWARD;
		m_flWishDirection = vBase.yaw + Directions::FORWARDS;
	}

	// TODO: Fix clamping
	float flSpeedRotation = std::min(Math::RadToDeg(std::asinf(30.f / g_LocalPlayer->m_vecVelocity().Length2D())) * 0.5f, 45.f);
	if (m_bInTransition)
	{
		// Unused, might make an option in future if improved
		float flIdealStep = flSpeedRotation + m_flCalculatedDirection;
		m_flStep = fabsf(Math::NormalizeYaw(m_flCalculatedDirection - flIdealStep));

		if (fabsf(Math::NormalizeYaw(m_flWishDirection - m_flCalculatedDirection)) > m_flStep)
		{
			float flAdd = Math::NormalizeYaw(m_flCalculatedDirection + m_flStep);
			float flSub = Math::NormalizeYaw(m_flCalculatedDirection - m_flStep);

			if (fabsf(Math::NormalizeYaw(m_flWishDirection - flAdd)) >= fabsf(Math::NormalizeYaw(m_flWishDirection - flSub)))
			{
				m_flCalculatedDirection -= m_flStep;
			}
			else {
				m_flCalculatedDirection += m_flStep;
			}
		}
		else
		{
			m_bInTransition = false;
		}
	}
	else
	{
		m_flRoughDirection = flGetRoughDirection(m_flTrueDirection);
		m_flCalculatedDirection = m_flRoughDirection;

		if (m_flRoughDirection != m_flWishDirection)
		{
			m_bInTransition = true;
		}
	}

	cmd->forwardmove = 0.f;
	cmd->sidemove = cmd->command_number % 2 ? 450.f : -450.f;

	float flDirection = (cmd->command_number % 2 ? flSpeedRotation : -flSpeedRotation) + m_flCalculatedDirection;

	float rotation = Math::DegToRad(vBase.yaw - flDirection);

	float flCosRotation = cos(rotation);
	float flSinRotation = sin(rotation);

	float flForwardmove = (flCosRotation * cmd->forwardmove) - (flSinRotation * cmd->sidemove);
	float flSidemove = (flSinRotation * cmd->forwardmove) + (flCosRotation * cmd->sidemove);

	cmd->forwardmove = flForwardmove;
	cmd->sidemove = flSidemove;

}

void Misc::DoClantag()
{
	static int clantag_counter = 0;
	static std::string clantag_string = " ";

	if (Variables.MiscClantag)
	{
		switch (Variables.MiscClantag)
		{
		case 0:
			break;
		case 1:
			clantag_string = " Xanity.cc ";
			break;
		case 2:
			clantag_string = " CarceaHOOK ";
			break;
		}

		if (++clantag_counter > 25) {
			std::rotate(clantag_string.begin(), clantag_string.begin() + 1, clantag_string.end());
			Utils::SetClantag(clantag_string.c_str());
			clantag_counter = 0;
		}
	}
}

void Misc::DoFakeDuck(CUserCmd* cmd)
{
	if (Variables.MiscFakeDuckKey)
	{
		int limit = 7;
		bool crouch = g_EngineClient->GetNetChannel()->m_nChokedPackets > limit;

		cmd->buttons |= IN_BULLRUSH;
		if (GetAsyncKeyState(Variables.MiscFakeDuckKey))
		{
			if (crouch)
				cmd->buttons |= IN_DUCK;
			else
				cmd->buttons &= ~IN_DUCK;
		}
	}
}














